import React from 'react';
import Part from './Part';

const Content = ({ course }) => {
	return (
		<div>
			<Part data={course.parts[0].name} />
			<Part data={course.parts[1].name} />
			<Part data={course.parts[2].name} />
		</div>
	);
};

export default Content;
